  \n*\n\nWrite the following code in the file to create a writer module to be exported.  (Ignore comments in code below)\n*\n\nCreate an app.js file and do the following:\nUse the require keyword to load the writer.js module.\nInvoke (call) the writeData method from the writer.js module to write the text to the file.\nRun the app.js at the command line.\n*\n\n\nThe finished file structure should be as follows.\n*\n[Expected Output]\n\u000b*\n\nExercise #3 – Pipes\n\nOpen a command prompt create a directory for exercise-3\nOpen Visual Studio Code and open the folder exercise-3\n Create a new file named pipes.js file.  \n*\nInstall third party module named ‘request’ using the following command.\n*\nAfter the module is installed your directory will have this structure.\n*\n\nIn pipe.js write the following code.\n*\nRun pipe.js file on the command line\n*\n\nExpected result is the html from the website will be outputted to console.\n*\n\nRead the documentation on the request module and pipe\nhttps://www.npmjs.com/package/request\nhttps://nodejs.org/api/stream.html#stream_event_pipe\n\n     8. Change the code to do the following:\n The request object is by default a readable stream, use the pipe event on it\n Chain the pipe into a writeable stream that will write the HTML into a file named output.html.\n\n[Expected Result]\n\nThe directory should look as follows with a new file created named output.html\n*\n\nInside the output.html should be the html from the request response.\n\n*\n\n\nExercise #4– Callbacks and Asynchronous Code – Part 1\nOpen a command prompt create a directory for exercise-4\nOpen Visual Studio Code and open the folder exercise-4\n Create a new file named start.js file.\nIn start.js, write the following code for a function to be used as a callback.\n*\n\nCreate a function named callbackLoop that will take a count and the callback function as parameters.  This function will iterate over the given counter and invoke (call) the callback function each ti
